import React, { useEffect, useState } from 'react'
import axios from 'axios'
import Card from '../Components/Card'

function Cafe(){
    const url = 'http://127.0.0.1:5000/api/v1/cafe'
    const [cafes,setCafes] = useState({},[url])

    useEffect(()=>{
        axios.get(url)
            .then(response =>{
                setCafes(response.data)
            })
    }, [url])

    let content = null

    if(cafes.result){
        content =  
            cafes.result.map((cafe,key)=>
                <div key = {key}>
                    <Card 
                        info = {cafe}
                    />
                </div>
            )

    }

    return(
        <section>

        </section>
    )
}

export default Cafe
